import request from '@/utils/request'

export function listDispenserLog(query) {
  return request({
    url: '/dispenserlog/list',
    method: 'get',
    params: query
  })
}

export function createDispenserLog(data) {
  return request({
    url: '/dispenserlog/create',
    method: 'post',
    data
  })
}

export function readDispenserLog(data) {
  return request({
    url: '/dispenserlog/read',
    method: 'get',
    data
  })
}

export function updateDispenserLog(data) {
  return request({
    url: '/dispenserlog/update',
    method: 'post',
    data
  })
}

export function deleteDispenserLog(data) {
  return request({
    url: '/dispenserlog/delete',
    method: 'post',
    data
  })
}
